'use strict';

var F = require( './../lib' );

var f = new F( 5.0, 6.0 );

var mu = f.mean;
console.log( 'Mean = %d', mu );
// => Mean = 1.5

var mode = f.mode;
console.log( 'Mode = %d', mode );
// => Mode = 0.44999999999999996

var s2 = f.variance;
console.log( 'Variance = %d', s2 );
// => Variance = 4.05

var y = f.cdf( 0.8 );
console.log( 'F(0.8) = %d', y );
// => F(0.8) = 0.41236100577552703

